(19, 4, 'fw:opt:ext:pb:page-builder:json', '[{\"type\":\"column\",\"width\":\"1_1\",\"atts\":{\"id\":\"c17fa00467b6b62fc9ed44f597e29450\",\"html_label\":\"\",\"padding_top\":\"0\",\"padding_right\":\"0\",\"padding_bottom\":\"0\",\"padding_left\":\"0\",\"tablet\":\"\",\"class\":\"\"},\"_items\":[{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"What I Do\",\"color_title_part\":\"\",\"description\":\"\"}}]},{\"type\":\"column\",\"width\":\"1_2\",\"atts\":{\"id\":\"1822cbb2130d2293793432f173f78f34\",\"html_label\":\"\",\"padding_top\":\"0\",\"padding_right\":\"0\",\"padding_bottom\":\"0\",\"padding_left\":\"0\",\"tablet\":\"\",\"class\":\"\"},\"_items\":[{\"type\":\"simple\",\"shortcode\":\"info_list_2\",\"atts\":{\"title\":\"\",\"infolist_with_icons\":[{\"id\":\"9280b879be70f98ee1600f011f09dbd7\",\"icon\":{\"type\":\"icon-font\",\"icon-class\":\"linecons linecons-world\",\"icon-class-without-root\":\"linecons-world\",\"pack-name\":\"linecons\",\"pack-css-uri\":\"http:\\/\\/localhost\\/portfolio_Kanchon\\/wp-content\\/plugins\\/unyson\\/framework\\/static\\/libs\\/linecons\\/css\\/linecons.css\"},\"title\":\"Full-Stack Web Development\",\"text\":\"I have been working in web development for about 5 years. Experienced in both frontend and backend web development. Usually, I prefer to use regular bootstrap and Js based frontend and Django in the backend. Having some skills in typescript, ES6, vanilla js, jQuery, etc. In the terms of server-side language, I also worked with MySQL, PostgreSQL, MongoDB, and SQLite.\\r\\n<br>\\r\\nExperienced with PHP and WordPress sites also. Recently I have been working on the MERN stack to gather more experience. \\r\\n\",\"icon_color\":\"#888\"},{\"id\":\"72dfa3d6b913f7563884568ec3ef89fa\",\"icon\":{\"type\":\"icon-font\",\"icon-class\":\"linecons linecons-phone\",\"icon-class-without-root\":\"linecons-phone\",\"pack-name\":\"linecons\",\"pack-css-uri\":\"http:\\/\\/localhost\\/portfolio_Kanchon\\/wp-content\\/plugins\\/unyson\\/framework\\/static\\/libs\\/linecons\\/css\\/linecons.css\"},\"title\":\"App Development\",\"text\":\"I have worked with flutter app development both for both Android and iOS. Can code custom UI\\/Design with provided XD\\/Figma UI. Prefer to use firebase as a database with my app.\",\"icon_color\":\"#888\"},{\"id\":\"165c07d09b23d5d8972b2c046d61b8ba\",\"icon\":{\"type\":\"icon-font\",\"icon-class\":\"linecons linecons-pen\",\"icon-class-without-root\":\"linecons-pen\",\"pack-name\":\"linecons\",\"pack-css-uri\":\"http:\\/\\/localhost\\/portfolio_Kanchon\\/wp-content\\/plugins\\/unyson\\/framework\\/static\\/libs\\/linecons\\/css\\/linecons.css\"},\"title\":\"UI UX Design\",\"text\":\"Design is the first important thing in a product for your user\'s Acquisition!Do you care about your customers and need the high-quality attractive professional UI UX, prototype, App Ui UX, web Ui UX or wireframe? if yes then you are on the right place.\\r\\n<br>\\r\\n\\r\\nI will design a professional UI UX (Screens), prototype, and wireframe for your Android, IOS app, or web UI UX using proper Apple and Google guidelines, My design will be user-friendly and eye-catching. Love to work with fresh and minimalistic corporate-looking designs.\",\"icon_color\":\"#888\"},{\"id\":\"52e144460ef68303f8ccf9a1e059d0af\",\"icon\":{\"type\":\"icon-font\",\"icon-class\":\"linecons linecons-lab\",\"icon-class-without-root\":\"linecons-lab\",\"pack-name\":\"linecons\",\"pack-css-uri\":\"http:\\/\\/localhost\\/portfolio_Kanchon\\/wp-content\\/plugins\\/unyson\\/framework\\/static\\/libs\\/linecons\\/css\\/linecons.css\"},\"title\":\"Apprentice Researcher\",\"text\":\"Recently I have been trying to start research on a few topics. This is a completely new journey without any previous experience of mine. Hope to do well on this challenging journey.\",\"icon_color\":\"#888\"}]}}]},{\"type\":\"column\",\"width\":\"1_2\",\"atts\":{\"id\":\"27f08604b6aa10e2c3fc7ec52df3fccf\",\"html_label\":\"\",\"padding_top\":\"0\",\"padding_right\":\"0\",\"padding_bottom\":\"0\",\"padding_left\":\"0\",\"tablet\":\"\",\"class\":\"\"},\"_items\":[{\"type\":\"simple\",\"shortcode\":\"info_list_2\",\"atts\":{\"title\":\"\",\"infolist_with_icons\":[{\"id\":\"222cb19cd61c9b44aa8ca4c932a0cfb2\",\"icon\":{\"type\":\"icon-font\",\"icon-class\":\"lnr lnr-magic-wand\",\"icon-class-without-root\":\"lnr-magic-wand\",\"pack-name\":\"linearicons\",\"pack-css-uri\":\"http:\\/\\/localhost\\/portfolio_Kanchon\\/wp-content\\/plugins\\/unyson\\/framework\\/static\\/libs\\/lnr\\/css\\/lnr.css\"},\"title\":\"Graphic Design\",\"text\":\"I am a passionate graphic designer, working for some fun, entertainment, and exploring the art of the world. I do a lot of work with 2D and 3D graphics in various fields like digital illustration, and arts, character designing, game assets implementation, photo manipulation, poster and banner designing, bla bla....\\r\\n\\r\\nHas experience working with software like Photoshop, Illustrator, Fireworks, Lightroom, Filmora, Premier Pro, After Effects, Blender, etc. Usually, I love working on the minimalistic theme.<br>\",\"icon_color\":\"#888\"},{\"id\":\"39cdc513a38c9e863ff4c013ad3550bd\",\"icon\":{\"type\":\"icon-font\",\"icon-class\":\"lnr lnr-rocket\",\"icon-class-without-root\":\"lnr-rocket\",\"pack-name\":\"linearicons\",\"pack-css-uri\":\"http:\\/\\/localhost\\/portfolio_Kanchon\\/wp-content\\/plugins\\/unyson\\/framework\\/static\\/libs\\/lnr\\/css\\/lnr.css\"},\"title\":\"IOT Solution Design\",\"text\":\"Have worked in firmware design and hardware system implementation. Worked as project manager of IOT team of Project SUROKKHA.\\r\\nInterested to work with Arduino, node, and raspberry pi. \",\"icon_color\":\"#888\"},{\"id\":\"083494bcd1fbf79c631adfb80ea4c40e\",\"icon\":{\"type\":\"icon-font\",\"icon-class\":\"lnr lnr-briefcase\",\"icon-class-without-root\":\"lnr-briefcase\",\"pack-name\":\"linearicons\",\"pack-css-uri\":\"http:\\/\\/localhost\\/portfolio_Kanchon\\/wp-content\\/plugins\\/unyson\\/framework\\/static\\/libs\\/lnr\\/css\\/lnr.css\"},\"title\":\"Pitch Deck Design\",\"text\":\"I am a Professional PowerPoint Business Presentation Specialist and a Marketing Communication proficient with lots of experience. I love to work with fresh and minimalist corporate-looking designs. Besides this, I can also prepare artistic looking or explorer or entertainment full of childish theme-based design. My quality of design is a silent ambassador of your Brand! I specialize in presentation design. These include:\\r\\nInvestor Pitch Decks (for startups)\\r\\nSales \\/ Training \\/ Company Overview Decks, \\r\\nUpdates to Leadership, \\r\\nClient Reports, \\r\\nWebinars, \\r\\nTemplates, \\r\\n& more.\",\"icon_color\":\"#888\"},{\"id\":\"783c39256ece00203be94197dbcb6f26\",\"icon\":{\"type\":\"icon-font\",\"icon-class\":\"lnr lnr-screen\",\"icon-class-without-root\":\"lnr-screen\",\"pack-name\":\"linearicons\",\"pack-css-uri\":\"http:\\/\\/localhost\\/portfolio_Kanchon\\/wp-content\\/plugins\\/unyson\\/framework\\/static\\/libs\\/lnr\\/css\\/lnr.css\"},\"title\":\".net Development\",\"text\":\"As a time passing skill development works, I have worked with C# .net software development in the Visual studio platform. I have made some simple projects like media player, notepad, calculator, etc.\",\"icon_color\":\"#888\"}]}}]},{\"type\":\"simple\",\"shortcode\":\"divider\",\"atts\":{\"style\":{\"ruler_type\":\"space\",\"space\":{\"height\":\"50\"}}}},{\"type\":\"column\",\"width\":\"1_1\",\"atts\":{\"id\":\"d3a69f6048aa6a09e415ced6f12b4f01\",\"html_label\":\"\",\"padding_top\":\"20\",\"padding_right\":\"0\",\"padding_bottom\":\"40\",\"padding_left\":\"0\",\"tablet\":\"\",\"class\":\"\"},\"_items\":[{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Testimonials\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"testimonials_slider\",\"att