":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Co-Curricular Activities\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"timeline\",\"atts\":{\"title\":\"\",\"timeline_style\":\"timeline-second-style\",\"timeline\":[{\"id\":\"b9b5764f6c028a1294f1293bc119ef32\",\"period\":\"2018~Running\",\"title\":\"Martial Artist\",\"subtitle\":\"Rajshahi Tkd. Dojang\",\"text\":\"<p>Martial arts was one of my childhood passions. To complete my dream In the year 2018 I joined a taekwondo school and continue my journey on it. After 3 years of rigorous practice, I was able to reach my goal by getting 1st Dan Blackbelt from Bangladesh Tkd. Federation!<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"1bb2242e0b1d0b54bfca28bb7b491aef\",\"period\":\"2008~2019\",\"title\":\"Passionate Chess Player\",\"subtitle\":\"Rajshahi Chess Arena & Ruet Chess Club\",\"text\":\"<p>Participated in the Divisional Junior Chess Tournament five times, became a champion three times and a runner-up once. Also achieved sixth place in the national junior chess tournament 2014.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"a5a443b8c20f7e37f9001a26d57b0f50\",\"period\":\"2015~2017\",\"title\":\"Olympiad Enthusiast\",\"subtitle\":\"National Math & Physics Olympiad\",\"text\":\"<p>The Math and Physics Olympiads have always been very exciting competitions for me. After passing the regional round I participated twice in the National Mathematics Olympiad and once in the National Physics Olympiad in my college life.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"ff658775142f4cc048416365c08ea85f\",\"period\":\"2019 - 2020\",\"title\":\"Lead Ui\\/Ux Designer\",\"subtitle\":\"Code Studio\",\"text\":\"<p>Worked in Code Studio, a local software company, as a lead UI UX designer and graphics designer for almost ten projects.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"9a56022246ae9b7607bcc481b6cb96bf\",\"period\":\"2019 - Running\",\"title\":\"Treasurer & Organizer\",\"subtitle\":\"Ruet Chess Club\",\"text\":\"<p>As a passionate chess player, I joined as a member of the RUET Chess Club and was promoted to Treasurer after 1 year.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"}]}}]},{\"type\":\"column\",\"width\":\"1_3\",\"atts\":{\"id\":\"cb8a2d7a43ffa4c8a40b455448316734\",\"html_label\":\"\",\"padding_top\":\"0\",\"padding_right\":\"0\",\"padding_bottom\":\"0\",\"padding_left\":\"0\",\"tablet\":\"\",\"class\":\"\"},\"_items\":[{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Design Skills\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"skills\",\"atts\":{\"title\":\"\",\"skills_style\":\"skills-second-style\",\"skills\":[{\"id\":\"dac73e965e9f4777e57fa89ede187ab8\",\"title\":\"Web Design\",\"value\":\"95\",\"color\":\"#0099e5\"},{\"id\":\"6d714613be79f0b599436796c7d25444\",\"title\":\"Print Design\",\"value\":\"65\",\"color\":\"#0099e5\"},{\"id\":\"40cafd150cc54bf4db0fab34ef764fae\",\"title\":\"Logo Design\",\"value\":\"80\",\"color\":\"#0099e5\"},{\"id\":\"7ad022f1fb26ea8e1a164ee5115e9d82\",\"title\":\"Graphic Design\",\"value\":\"90\",\"color\":\"#0099e5\"}]}},{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Coding Skills\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"skills\",\"atts\":{\"title\":\"\",\"skills_style\":\"skills-second-style\",\"skills\":[{\"id\":\"ffc0c0eb95eca18bf4c6ff0a75020adf\",\"title\":\"JavaScript\",\"value\":\"85\",\"color\":\"#0099e5\"},{\"id\":\"8cfe7b82b5dd93334224bbe9f283e2fb\",\"title\":\"PHP\",\"value\":\"70\",\"color\":\"#0099e5\"},{\"id\":\"46bcfcc7b1edf93255525d3a3249f963\",\"title\":\"Python\",\"value\":\"60\",\"color\":\"#0099e5\"},{\"id\":\"35980444dce5f6d1a750bc2b7e6f3258\",\"title\":\"Perl\",\"value\":\"75\",\"color\":\"#0099e5\"},{\"id\":\"d9463