(490, 160, 'fw:opt:ext:pb:page-builder:json', '[{\"type\":\"column\",\"width\":\"2_3\",\"atts\":{\"id\":\"1e3b1c14d427d12506937b1793be62e5\",\"html_label\":\"\",\"padding_top\":\"0\",\"padding_right\":\"0\",\"padding_bottom\":\"30\",\"padding_left\":\"0\",\"tablet\":\"\",\"class\":\"\"},\"_items\":[{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Education\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"timeline\",\"atts\":{\"title\":\"\",\"timeline_style\":\"timeline-second-style\",\"timeline\":[{\"id\":\"fd89edd82db78861e1b8af96e3ac01ae\",\"period\":\"2017~Running\",\"title\":\"Dept. of Computer Science & Engineering, RUET\",\"subtitle\":\"BSc\",\"text\":\"<p>Now I am continuing my study with Computer Science and Engineering Dept at Rajshahi University of Engineering &amp; Technology in the 17 series.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"cf2aaf313eacc4cb71b4c9e333d22fbd\",\"period\":\"2015~2017\",\"title\":\"Rajshahi Collegiate School & College\",\"subtitle\":\"HSC\",\"text\":\"<p>I spent my college life in Rajshahi Collegiate School and College. It was a delightful and memorable journey for me.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"bdf3aaecbb40d38f42e5f6d0be61655c\",\"period\":\"2015\",\"title\":\"Rajshahi B B Hindu Academy\",\"subtitle\":\"SSC\",\"text\":\"<p>The school where I spent most of my education is Rajshahi B B Hindu Academy. It was a great journey that was full of fun, entertaining, lots of experiences that kept me some nostalgic memories in my life.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"}]}},{\"type\":\"simple\",\"shortcode\":\"divider\",\"atts\":{\"style\":{\"ruler_type\":\"space\",\"space\":{\"height\":\"50\"}}}},{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Experience\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"timeline\",\"atts\":{\"title\":\"\",\"timeline_style\":\"timeline-second-style\",\"timeline\":[{\"id\":\"2396530f13701ad8c627d3a3126dff26\",\"period\":\"2020 - Current\",\"title\":\"Chief Technical Officer\",\"subtitle\":\"Surokkha\",\"text\":\"<p>Currently, I am working with the startup SUROKKHA sponsored by idea Project and Startup Bangladesh as a CTO. Responsible for :<\\/p><ul><li>Website and App development<\\/li><li>Technical Maintenance<\\/li><li>IOT Co-Ordinator<\\/li><li>UI\\/UX Designing<\\/li><li>Project Designing &amp; Development<\\/li><\\/ul>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"0ebf7bf1f20c09e210c10db494be0b3c\",\"period\":\"2021 - Current\",\"title\":\"Freelance Developer\",\"subtitle\":\"freelancer.com\",\"text\":\"<p>Currently working as a part-time freelance developer in freelancer.com. Working with graphics design, UI UX, &amp; web development.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"ae39df262b4dcc7ca91115ff90efa4d7\",\"period\":\"2019 - 2020\",\"title\":\"Frontend Designer\",\"subtitle\":\"Code Studio\",\"text\":\"<p>Worked in Code Studio, a local software company, as a frontend designer.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"ff854ec2cce2dc11c6e23eee03fb4552\",\"period\":\"2019 - 2020\",\"title\":\"Lead Ui\\/Ux Designer\",\"subtitle\":\"Code Studio\",\"text\":\"<p>Worked in Code Studio, a local software company, as a lead UI UX designer and graphics designer for almost ten projects.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"732fca67be980d98c9db226eec21c109\",\"period\":\"2019 - 2019\",\"title\":\"Game Asset Designer\",\"subtitle\":\"GameKarkhana\",\"text\":\"<p>I worked with a game development project on the asset designing team. This is basically an endy game that was run by a team called Gamekarkhana for research and development purposes.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"6c2a5af8ee8b6ca298f2adce5cd4d516\",\"period\":\"2019 - Running\",\"title\":\"Treasurer & Organizer\",\"subtitle\":\"Ruet Chess Club\",\"text\":\"<p>As a passionate chess player, I joined as a member of the RUET Chess Club and was promoted to Treasurer after 1 year.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"}]}},{\"type\":\"simple\",\"shortcode\":\"divider\",\"atts\":{\"style\":{\"ruler_type\":\"space\",\"space\":{\"height\":\"30\"}}}},{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Co-Curricular Activities\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"timeline\",\"atts\":{\"title\":\"\",\"timeline_style\":\"timeline-second-style\",\"timeline\":[{\"id\":\"2a61d5d543c16a83dbdf68af95cc1086\",\"period\":\"2018~Running\",\"title\":\"Martial Artist\",\"subtitle\":\"Rajshahi Tkd. Dojang\",\"text\":\"<p>Martial arts was one of my childhood passions. To complete my dream In the year 2018 I joined a taekwondo school and continue my journey on it. After 3 years of rigorous practice, I was able to reach my goal by getting 1st Dan Blackbelt from Bangladesh Tkd. Federation!<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"dfd0c7579df933e984abb4bd5b71c31a\",\"period\":\"2008~2019\",\"title\":\"Passionate Chess Player\",\"subtitle\":\"Rajshahi Chess Arena & Ruet Chess Club\",\"text\":\"<p>Participated in the Divisional Junior Chess Tournament five times, became a champion three times and a runner-up once. Also achieved sixth place in the national junior chess tournament 2014.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"},{\"id\":\"7068249afbe1847e5d7362d2bfa22d09\",\"period\":\"2015~2017\",\"title\":\"Olympiad Enthusiast\",\"subtitle\":\"National Math & Physics Olympiad\",\"text\":\"<p>The Math and Physics Olympiads have always been very exciting competitions for me. After passing the regional round I participated twice in the National Mathematics Olympiad and once in the National Physics Olympiad in my college life.<\\/p>\",\"logo\":\"\",\"period_color\":\"#9bd952\"}]}}]},{\"type\":\"column\",\"width\":\"1_3\",\"atts\":{\"id\":\"cb8a2d7a43ffa4c8a40b455448316734\",\"html_label\":\"\",\"padding_top\":\"0\",\"padding_right\":\"0\",\"padding_bottom\":\"0\",\"padding_left\":\"0\",\"tablet\":\"\",\"class\":\"\"},\"_items\":[{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Development Skills\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"skills\",\"atts\":{\"title\":\"\",\"skills_style\":\"skills-second-style\",\"skills\":[{\"id\":\"dac73e965e9f4777e57fa89ede187ab8\",\"title\":\"Full-Stack Web Development\",\"value\":\"95\",\"color\":\"#0099e5\"},{\"id\":\"6d714613be79f0b599436796c7d25444\",\"title\":\"IOT Development\",\"value\":\"45\",\"color\":\"#0099e5\"},{\"id\":\"40cafd150cc54bf4db0fab34ef764fae\",\"title\":\"App Development\",\"value\":\"30\",\"color\":\"#0099e5\"},{\"id\":\"7ad022f1fb26ea8e1a164ee5115e9d82\",\"title\":\".net Development\",\"value\":\"20\",\"color\":\"#0099e5\"},{\"id\":\"a5ed92bdfd58902a02d21c23f932682b\",\"title\":\"CMS Skills\",\"value\":\"70\",\"color\":\"#0099e5\"}]}},{\"type\":\"simple\",\"shortcode\":\"divider\",\"atts\":{\"style\":{\"ruler_type\":\"space\",\"space\":{\"height\":\"40\"}}}},{\"type\":\"simple\",\"shortcode\":\"block_title\",\"atts\":{\"block_id\":\"\",\"title\":\"Designing Skills\",\"color_title_part\":\"\",\"description\":\"\"}},{\"type\":\"simple\",\"shortcode\":\"skills\",\"atts\":{\"title\":\"\",\"skills_style\":\"skills-second-style\",\"skills\":[{\"id\":\"ffc0c0eb95eca18bf4c6ff0a75020adf\",\"title\":\"UI UX Design\",\"value\":\"95\",\"color\":\"#0099e5\"},{\"id\":\"8cfe7b82b5dd93334224bbe9f283e2fb\",\"title\":\"Vector Art\",\"value\":\"85\",\"color\":\"#0099e5\"},{\"id\":\"46bcfcc7b1edf93255525d3a3249f963\",\"title\":\"Pitch Deck Design\",\"value\":\"95\",\"color\":\"#0099e5\"},{\"id\":\"35980444dce5f6d1a750bc2b7e6f3258\",\"title\":\"Print Design\",\"value\":\"85\",\"color\