(146, 1, '2021-04-26 12:43:03', '2021-04-26 12:43:03', '<section class=\"fw-main-row \">\n	<div class=\"fw-container\">\n		<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-12 \">\r\n    <div id=\"col_inner_id-6086b5570a3d1\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div class=\"block-title\">\n    <h3>What I Do<span></span></h3>\n</div>\n	</div>\r\n</div>\r\n</div>\n\n<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-6 \">\r\n    <div id=\"col_inner_id-6086b5570a94c\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div id=\"info-list-6086b5570aba5\" class=\"info-list-w-icon\">\n	\n					<div id=\"info_block_with_icon_d66f1230439b89d79cbc90927d646f47\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"linecons linecons-world\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>Full-Stack Web Development</h4>\n		        <p>I have been working in web development for about 5 years. Experienced in both frontend and backend web development. Usually, I prefer to use regular bootstrap and Js based frontend and Django in the backend. Having some skills in typescript, ES6, vanilla js, jQuery, etc. In the terms of server-side language, I also worked with MySQL, PostgreSQL, MongoDB, and SQLite.\r\n<br>\r\nExperienced with PHP and WordPress sites also. Recently I have been working on the MERN stack to gather more experience. \r\n</p>\n		    </div>\n		</div>\n					<div id=\"info_block_with_icon_9a2cd5ac97c47baf3eb0c829c3859bf7\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"linecons linecons-phone\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>App Development</h4>\n		        <p>I have worked with flutter app development both for both Android and iOS. Can code custom UI/Design with provided XD/Figma UI. Prefer to use firebase as a database with my app.</p>\n		    </div>\n		</div>\n					<div id=\"info_block_with_icon_5e292924a72adaf14eaf1f7eef853242\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"linecons linecons-pen\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>UI UX Design</h4>\n		        <p>Design is the first important thing in a product for your user\'s Acquisition!Do you care about your customers and need the high-quality attractive professional UI UX, prototype, App Ui UX, web Ui UX or wireframe? if yes then you are on the right place.\r\n<br>\r\n\r\nI will design a professional UI UX (Screens), prototype, and wireframe for your Android, IOS app, or web UI UX using proper Apple and Google guidelines, My design will be user-friendly and eye-catching. Love to work with fresh and minimalistic corporate-looking designs.</p>\n		    </div>\n		</div>\n					<div id=\"info_block_with_icon_5a919368e30c4e848348378b1f8911fd\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"linecons linecons-lab\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>Apprentice Researcher</h4>\n		        <p>Recently I have been trying to start research on a few topics. This is a completely new journey without any previous experience of mine. Hope to do well on this challenging journey.</p>\n		    </div>\n		</div>\n	</div>\n	</div>\r\n</div>\r\n\r\n\r\n<div class=\" col-xs-12 col-sm-6 \">\r\n    <div id=\"col_inner_id-6086b5570ae5a\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div id=\"info-list-6086b5570b0c8\" class=\"info-list-w-icon\">\n	\n					<div id=\"info_block_with_icon_f0d11e38f11e1122e244cd8d7cce8068\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"lnr lnr-magic-wand\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>Graphic Design</h4>\n		        <p>I am a passionate graphic designer, working for some fun, entertainment, and exploring the art of the world. I do a lot of work with 2D and 3D graphics in various fields like digital illustration, and arts, character designing, game assets implementation, photo manipulation, poster and banner designing, bla bla....\r\n\r\nHas experience working with software like Photoshop, Illustrator, Fireworks, Lightroom, Filmora, Premier Pro, After Effects, Blender, etc. Usually, I love working on the minimalistic theme.<br></p>\n		    </div>\n		</div>\n					<div id=\"info_block_with_icon_6bb55dd187ccbeb21ba0fbd01b79b458\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"lnr lnr-rocket\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>IOT Solution Design</h4>\n		        <p>Have worked in firmware design and hardware system implementation. Worked as project manager of IOT team of Project SUROKKHA.\r\nInterested to work with Arduino, node, and raspberry pi. </p>\n		    </div>\n		</div>\n					<div id=\"info_block_with_icon_5468f0285a2d7396e7c611504eb1e86d\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"lnr lnr-briefcase\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>Pitch Deck Design</h4>\n		        <p>I am a Professional PowerPoint Business Presentation Specialist and a Marketing Communication proficient with lots of experience. I love to work with fresh and minimalist corporate-looking designs. Besides this, I can also prepare artistic looking or explorer or entertainment full of childish theme-based design. My quality of design is a silent ambassador of your Brand! I specialize in presentation design. These include:\r\nInvestor Pitch Decks (for startups)\r\nSales / Training / Company Overview Decks, \r\nUpdates to Leadership, \r\nClient Reports, \r\nWebinars, \r\nTemplates, \r\n&amp; more.</p>\n		    </div>\n		</div>\n					<div id=\"info_block_with_icon_26a8c9186bdaaa6a4696269b8e65b34e\" class=\"info-block-w-icon\" data-color=\"#888\">\n				    <div class=\"ci-icon\">\n		        		        	                        <i class=\"lnr lnr-screen\"></i>\n		                		    </div>\n		    <div class=\"ci-text\">\n		        <h4>.net Development</h4>\n		        <p>As a time passing skill development works, I have worked with C# .net software development in the Visual studio platform. I have made some simple projects like media player, notepad, calculator, etc.</p>\n		    </div>\n		</div>\n	</div>\n	</div>\r\n</div>\r\n</div>\n\n<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-12 \">\r\n    <div id=\"col_inner_id-6086b5570c502\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n	<div class=\"fw-divider-space\" style=\"padding-top: 50px\"></div>\n	</div>\r\n</div>\r\n</div>\n\n<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-12 \">\r\n    <div id=\"col_inner_id-6086b5570cb18\" class=\"fw-col-inner\" data-paddings=\"20px 0px 40px 0px\">\r\n		\n<div class=\"block-title\">\n    <h3>Testimonials<span></span></h3>\n</div>\n\n\n<div id=\"testimonials_edfb1ebb770c4c699d918aa5dfe08c0d\" class=\"testimonials owl-carousel \n	testimonials-loop-off \n	autoplay-off	\" data-mobile-items=\"1\" data-tablet-items=\"2\" data-items=\"2\">\n\n			<!-- Testimonial testimonials-6086b5570ce66 -->\n		<div class=\"testimonial-item testimonial-testimonials-6086b5570ce66\">\n\n			<!-- Testimonial Content -->\n			<div class=\"testimonial-content\">\n				<div class=\"testimonial-text\">\n                    					   <p>Nam tempor commodo mi id sodales. Aenean sit amet nibh nec sapien consequ