(158, 1, '2021-04-26 13:28:54', '2021-04-26 13:28:54', '<section class=\"fw-main-row \">\n	<div class=\"fw-container\">\n		<div class=\"row\">\n	\r\n\r\n<div class=\" col-xs-12 col-sm-8 \">\r\n    <div id=\"col_inner_id-6086c0165a0f7\" class=\"fw-col-inner\" data-paddings=\"0px 0px 30px 0px\">\r\n		\n<div class=\"block-title\">\n    <h3>Education<span></span></h3>\n</div>\n\n\n<div id=\"timeline-6086c0165a42a\" class=\"timeline timeline-second-style clearfix\">\n					<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2017~Running</h5>\n				<span class=\"item-company\">BSc</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Dept. of Computer Science &amp; Engineering, RUET</h4>\n				<p><p>Now I am continuing my study with Computer Science and Engineering Dept at Rajshahi University of Engineering &amp; Technology in the 17 series.</p></p>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2015~2017</h5>\n				<span class=\"item-company\">HSC</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Rajshahi Collegiate School &amp; College</h4>\n				<p><p>I spent my college life in Rajshahi Collegiate School and College. It was a delightful and memorable journey for me.</p></p>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2015</h5>\n				<span class=\"item-company\">SSC</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Rajshahi B B Hindu Academy</h4>\n				<p><p>The school where I spent most of my education is Rajshahi B B Hindu Academy. It was a great journey that was full of fun, entertaining, lots of experiences that kept me some nostalgic memories in my life.</p></p>\n			</div>\n		</div>\n			</div>\n\n	<div class=\"fw-divider-space\" style=\"padding-top: 50px\"></div>\n\n<div class=\"block-title\">\n    <h3>Experience<span></span></h3>\n</div>\n\n\n<div id=\"timeline-6086c0165a9b1\" class=\"timeline timeline-second-style clearfix\">\n					<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2020 - Current</h5>\n				<span class=\"item-company\">Surokkha</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Chief Technical Officer</h4>\n				<p><p>Currently, I am working with the startup SUROKKHA sponsored by idea Project and Startup Bangladesh as a CTO. Responsible for :</p><ul><li>Website and App development</li><li>Technical Maintenance</li><li>IOT Co-Ordinator</li><li>UI/UX Designing</li><li>Project Designing &amp; Development</li></ul></p>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2021 - Current</h5>\n				<span class=\"item-company\">freelancer.com</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Freelance Developer</h4>\n				<p><p>Currently working as a part-time freelance developer in freelancer.com. Working with graphics design, UI UX, &amp; web development.</p></p>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2019 - 2020</h5>\n				<span class=\"item-company\">Code Studio</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Frontend Designer</h4>\n				<p><p>Worked in Code Studio, a local software company, as a frontend designer.</p></p>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2019 - 2020</h5>\n				<span class=\"item-company\">Code Studio</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Lead Ui/Ux Designer</h4>\n				<p><p>Worked in Code Studio, a local software company, as a lead UI UX designer and graphics designer for almost ten projects.</p></p>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2019 - Running</h5>\n				<span class=\"item-company\">Ruet Chess Club</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Treasurer &amp; Organizer</h4>\n				<p><p>As a passionate chess player, I joined as a member of the RUET Chess Club and was promoted to Treasurer after 1 year.</p></p>\n			</div>\n		</div>\n			</div>\n\n	<div class=\"fw-divider-space\" style=\"padding-top: 30px\"></div>\n\n<div class=\"block-title\">\n    <h3>Co-Curricular Activities<span></span></h3>\n</div>\n\n\n<div id=\"timeline-6086c0165c906\" class=\"timeline timeline-second-style clearfix\">\n					<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2018~Running</h5>\n				<span class=\"item-company\">Rajshahi Tkd. Dojang</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Martial Artist</h4>\n				<p><p>Martial arts was one of my childhood passions. To complete my dream In the year 2018 I joined a taekwondo school and continue my journey on it. After 3 years of rigorous practice, I was able to reach my goal by getting 1st Dan Blackbelt from Bangladesh Tkd. Federation!</p></p>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2008~2019</h5>\n				<span class=\"item-company\">Rajshahi Chess Arena &amp; Ruet Chess Club</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Passionate Chess Player</h4>\n				<p><p>Participated in the Divisional Junior Chess Tournament five times, became a champion three times and a runner-up once. Also achieved sixth place in the national junior chess tournament 2014.</p></p>\n			</div>\n		</div>\n							<div class=\"timeline-item clearfix\">\n			<div class=\"left-part\">\n				<h5 class=\"item-period\">2015~2017</h5>\n				<span class=\"item-company\">National Math &amp; Physics Olympiad</span>\n							</div>\n			<div class=\"divider\"></div>\n			<div class=\"right-part\">\n				<h4 class=\"item-title\">Olympiad Enthusiast</h4>\n				<p><p>The Math and Physics Olympiads have always been very exciting competitions for me. After passing the regional round I participated twice in the National Mathematics Olympiad and once in the National Physics Olympiad in my college life.</p></p>\n			</div>\n		</div>\n			</div>\n	</div>\r\n</div>\r\n\r\n\r\n<div class=\" col-xs-12 col-sm-4 \">\r\n    <div id=\"col_inner_id-6086c0165ccd1\" class=\"fw-col-inner\" data-paddings=\"0px 0px 0px 0px\">\r\n		\n<div class=\"block-title\">\n    <h3>Development Skills<span></span></h3>\n</div>\n\n\n<div id=\"skills-6086c0165cfb2\" class=\"skills-info skills-second-style\">\n						<div class=\"clearfix\">\n				<h4>Full-Stack Web Development</h4>\n				<div class=\"skill-value\">95%</div>\n			</div>\n			<div id=\"skill-3eeeb2852c68f703a86ea61754d473b4\" data-value=\"95\" data-color=\"#0099e5\" class=\"skill-container\">\n				<div class=\"skill-percentage\"></div>\n			</div>\n								<div class=\"clearfix\">\n				<h4>IOT Development</h4>\n				<div class=\"skill-value\">45%</div>\n			</div>\n			<div id=\"skill-934732ca8bbbcf8449b10fbef72d9808\" data-value=\"45\" data-color=\"#0099e5\" class=\"skill-container\">\n				<div class=\"skill-percentage\"></div>\n			</div>\n								<div class=\"clearfix\">\n				<h4>App Development</h4>\n				<div class=\"skill-value\">30%</div>\n			</div>\n			<div id=\"skill-6c535190045d284ed17a27b099a60c3e\" data-valu